import './App.css';

function App() {
  const movies = ['theri','bigil','3','kathi','ayan']
  return <div className ="App">
      {movies.map((movie,key) =>{
        return <h1 key = {key}>{movie}</h1>
      })}
  </div>

}


export default App;
